import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
    <div className="blank">
      Niceee
      <nav>
        <li>Home</li>
        <li>Service</li>
        <li>Contact</li>
      </nav>
    </div>
    </>
  );
}

export default App;
